fluid-und-grid-elements-gemeinsam-verwenden/\" rel=\"nofollow\" target=\"_blank\"></a></span>&nbsp;<span style=\"color: rgb(145, 145, 131); \"><a name=\"twitter_share\" type=\"button\" href=\"http://twitter.com/home?status=http://www.marmalade.de/magazin/2013/09/typo3-fluid-und-grid-elements-gemeinsam-verwenden/\" rel=\"nofollow\" target=\"_blank\"></a></span>&nbsp;<span style=\"color: rgb(145, 145, 131); \"><a rel=\"nofollow\" href=\"mailto:?subject=Artikel%20auf%20marmalade%20%3A%20TYPO3%3A%20Fluid%20und%20Grid%20Elements%20gemeinsam%20verwenden&amp;body=Ich%20empfehle%20den%20Beitrag%20%3A%20TYPO3%3A%20Fluid%20und%20Grid%20Elements%20gemeinsam%20verwenden.%20Hier%20kannst%20du%20ihn%20lesen%20%3A%20http%3A%2F%2Fwww.marmalade.de%2Fmagazin%2F2013%2F09%2Ftypo3-fluid-und-grid-elements-gemeinsam-verwenden%2F\" title=\"&lt;img src=\'http://www.marmalade.de/magazin/wp-content/themes/marmalade_gmbh/mail.png\'&gt; : TYPO3: Fluid und Grid Elements gemeinsam verwenden\"></a></span></div></div>\r\n<h1 class=\"entry-title\" style=\"font-weight: normal; font-family: Nexa-Bold; font-size: 22px; margin-top: 0px; margin-bottom: 2px; \">TYPO3: Fluid und Grid Elements gemeinsam verwenden</h1>\r\n<div class=\"wp_post_info\" style=\"padding: 0px 0px 10px; margin: 0px; font-family: Georgia; font-size: 15px; line-height: 18px; list-style: none outside none; \">geschrieben von&nbsp;<span class=\"vcard\"><span style=\"color: rgb(145, 145, 131); \"><a class=\"url fn n\" href=\"http://www.marmalade.de/magazin/author/j-richter/\" title=\"Jens Richter\" rel=\"me\">Jens Richter</a></span></span>	<br />&lt;time datetime=\"2013-09-02\" class=\"updated\" style=\"font-family: Nexa-Light; color: rgb(145, 145, 131); font-size: 12px; line-height: 16px; \"&gt;2. September 2013&lt;/time&gt;&nbsp;|&nbsp;<span style=\"color: rgb(145, 145, 131); \"><link http://www.marmalade.de/magazin/2013/09/typo3-fluid-und-grid-elements-gemeinsam-verwenden/#comments>7 Kommentare</link></span></div>\r\n<div class=\"wp_post_info\" style=\"padding: 0px 0px 10px; margin: 0px; font-family: Georgia; font-size: 15px; line-height: 18px; list-style: none outside none; \"></div></header>\r\n<div class=\"bodytext\" style=\"padding-bottom: 10px; margin-bottom: 55px; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(145, 145, 131); float: left; font-size: 0.95rem; font-family: \'Open Sans\', Arial; line-height: 1.5rem; \"><p style=\"margin-top: 0px; margin-bottom: 10px; -webkit-margin-after: 1.2em; \">Wie man Partials und ViewHelper für Gridelements nutzen kann: Alternativ zur normalen TypoScript-Konfiguration ist es möglich, die Darstellung eines Grid-Elements in einem einfachen HTML-Template zu definieren und dabei auf die Fähigkeiten von Fluid zurückzugreifen.</p>\r\n<p style=\"margin-top: 0px; margin-bottom: 10px; -webkit-margin-after: 1.2em; \">Die folgende Anleitung beschreibt die Verwendung von Fluid für die Frontendausgabe von Raster-Elementen. Sie wurde mit gridelements 2.0.2 unter TYPO3 6.1 getestet. Es wird vorausgesetzt, dass die gridelements-Extension bereits installiert ist und das statische TypoScript der Extension im Template eingebunden wurde.</p>\r\n<p style=\"margin-top: 0px; margin-bottom: 10px; -webkit-margin-after: 1.2em; \">Als Beispiel legen wir ein neues Gridelement (CE Backend Layout) mit zwei Zeilen und drei Spalten an, hierbei werden die beiden linken Elemente zu einer Sidebar und die beiden rechten oberen Spalten zu einer Spalte zusammengefasst. Dies kann entweder über die Raster-Konfiguration oder den Assistenten erfolgen.</p>\r\n<p style=\"margin-top: 0px; margin-bottom: 10px; -webkit-margin-after: 1.2em; \">Folgende Raster-Konfiguration liefert das gewünschte Ergebnis:</p></div></article></div></div></div>',	0,	0,	0,	2,	0,	0,	'0',	0,	0,	NULL,	NULL,	0,	0,	0,	'',	'',	'',	0,	'0',	'0',	'',	'',	1,	0,	NULL,	0,	'',	'',	0,	0,	0,	0,	0,	NULL,	'',	0,	'',	0,	'a:1:{s:6:\"hidden\";N;}',	NULL,	'',	NULL,	124,	0,	0,	0,	0,	0,	0,	0,	0,	0,	-2,	'',	0,	